	(1786, 104, 28, 'kfjk_socket_cx,所有程控功能状态查询,正常', '10.32.205.231:6612', '28   20046099000002100001013675181286~1;', '112f 2004609900000210000100;特服类型~特服代码~特服名称~特服状态~开通时间~关闭时间;10~10~40~8~25~25;可享受基于VoLTE的高清语音和高清视频服务，业务按时长计费，产生的流量核减。  1、使用高清语音业务须使用支持VoLTE的手机终端，由于终端和软件版本不同，对业务支持的程度不一，部分VoLTE终端仅支持高清语音，不支持高清视频。非VoLTE手机终端使用高清语音业务，会造成被叫接通时间延长。  2、高清语音业务语音通话和视频通话均按时长计费，语音通话与现行的2G/3G通话资费一致，适用现有的基础语音资费（含套餐和标准资费），通话过程中所产生的高清语音流量不收取流量费。视频通话国内被叫免费（不含港澳台地区），国内长市漫主叫单价为0.29元/分钟，不足1分钟的部分按1分钟计算，通话过程中产生的高清视频流量不收取流量费，视频通话不适用基础语音或3G视频通话资费（含套餐和标准资费）；  3、因网络覆盖和终端等原因不能进行高清语音通话时，会自动回落到2G/3G网络进行通话；拨打公共服务类电话，自动回落到2G/3G进行通话；  4、用户在关机场景下，和留言/短信呼等业务无法实现业务提醒功能； 5、彩铃用户无法使用多方通话功能；  6、部分用户设置呼叫等待后，切换到2G/3G网络下可能出现不能呼叫等待的现象； 7、部分用户关机状态下，存在无法正常播放关机提示音的现象；  8、使用高清语音业务不享受同城特例服务;~ProdClass_Voice~高清语音~开通~2017-04-27 10:17:39~2100-12-31 00:00:00;可享受基于VoLTE的高清语音和高清视频服务，业务按时长计费，产生的流量核减。  1、使用高清语音业务须使用支持VoLTE的手机终端，由于终端和软件版本不同，对业务支持的程度不一，部分VoLTE终端仅支持高清语音，不支持高清视频。非VoLTE手机终端使用高清语音业务，会造成被叫接通时间延长。  2、高清语音业务语音通话和视频通话均按时长计费，语音通话与现行的2G/3G通话资费一致，适用现有的基础语音资费（含套餐和标准资费），通话过程中所产生的高清语音流量不收取流量费。视频通话国内被叫免费（不含港澳台地区），国内长市漫主叫单价为0.29元/分钟，不足1分钟的部分按1分钟计算，通话过程中产生的高清视频流量不收取流量费，视频通话不适用基础语音或3G视频通话资费（含套餐和标准资费）；  3、因网络覆盖和终端等原因不能进行高清语音通话时，会自动回落到2G/3G网络进行通话；拨打公共服务类电话，自动回落到2G/3G进行通话；  4、用户在关机场景下，和留言/短信呼等业务无法实现业务提醒功能； 5、彩铃用户无法使用多方通话功能；  6、部分用户设置呼叫等待后，切换到2G/3G网络下可能出现不能呼叫等待的现象； 7、部分用户关机状态下，存在无法正常播放关机提示音的现象；  8、使用高清语音业务不享受同城特例服务;~ProdClass_Voice~高清语音~开通~2017-04-27 10:17:19~2017-08-22 10:17:19;港澳台 国际长途~ProdClass_Voice~国际及港澳台长途~开通~2016-12-31 00:00:00~2017-12-31 23:59:59;台港澳 国际漫游~ProdClass_Voice~国际及港澳台漫游~开通~2016-12-31 00:00:00~2017-12-31 23:59:59;呼叫保持~ProdClass_Voice~呼叫保持~开通~2014-10-15 13:02:38~2100-12-31 00:00:00;LTE 服务是客户具备享受中国移动提供4G服务的标识，便于更好的开展客户服务工作。~ProdClass_Voice~LTE服务~开通~2014-10-15 13:02:38~2100-12-31 00:00:00;数据~ProdClass_Voice~数据~开通~2014-10-15 13:02:38~2100-12-31 00:00:00;省内漫游~ProdClass_Voice~省内漫游~开通~2014-10-15 13:02:38~2100-12-31 00:00:00;呼叫转移~ProdClass_Voice~呼叫转移~开通~2014-10-15 13:02:38~2100-12-31 00:00:00;呼叫等待~ProdClass_Voice~呼叫等待~开通~201